import React from 'react';
import Mymodal from './Mymodal'

function useApiFunc(e) {
    console.log("virat", e.target.attributes.getNamedItem('types').value);
}

function Next(props) {
    return (
        <div>
            <i onClick={useApiFunc} types={props.types} data-toggle="modal" data-target="#myModal" style={{fontSize:'24px',cursor:'pointer'}} className="fa">&#xf101;</i>
            {/* <i onClick={props.onclickevent} types={props.types} style={{fontSize:'24px',cursor:'pointer'}} className="fa">&#xf101;</i> */}
            <Mymodal />
        </div>
    );
}
export default Next;
